export interface CucumberReportStepSchema {
    name: string;
    arguments: {
        [inde: string]: any;
    }[];
    keyword: string;
    line: number;
    hidden?: boolean;
    match: {
        location: string;
    };
    result: {
        status: string;
        duration: number;
        error_message: string;
    };
    embeddings: {
        mime_type: string;
        data: string;
    }[];
}
